import React, { Component } from "react";
import { Button, Table } from "react-bootstrap";
import axios from "axios";
import APIs from "../constants/APIs";

export default class Reports extends Component {
  constructor(props) {
    super(props);
    this.state = {
      income: [],
      expenses: [],
      totalIncome: 0,
      totalExpenses: 0,
      message: "",
    };
  }

  onViwe = () => {
    axios.get(APIs.SUMMARY_BASE_URL).then(
      (response) => {
        this.setState({
          income: response.data.income,
          expenses: response.data.expenses,
          totalIncome: response.data.totalIncome,
          totalExpenses: response.data.totalExpenses,
          message: "",
        });
      },
      (error) => {
        console.log(error);
        this.setState({
          message: "Report not found",
        });
      }
    );
  };

  render() {
    return (
      <div align="center">
        <h2>Reports</h2>
        <div className="my_workout">
          <table width="400px">
            <tbody align="left">
              <tr>
                <td>Generate Report</td>
                <td>
                  <Button
                    variant="primary"
                    type="submit"
                    onClick={this.onGenerate}
                  >
                    <span>Generate Report</span>
                  </Button>
                </td>
                <td>
                  <Button variant="primary" type="submit" onClick={this.onViwe}>
                    <span>View Report</span>
                  </Button>
                </td>
              </tr>
            </tbody>
          </table>
        </div>

        {this.state.message && (
          <h5 align="center" className="alert-warning">
            <i className="fa fa-warning"> {this.state.message}</i>
          </h5>
        )}

        {this.state.income.length > 0 && (
          <div>
            <h3>Income</h3>
            <Table striped bordered hover>
              <thead>
                <tr>
                  <th>Description</th>
                  <th>Amount</th>
                  <th>Date</th>
                </tr>
              </thead>
              <tbody>
                {this.state.income.map((item) => (
                  <tr key={item.id}>
                    <td>{item.description}</td>
                    <td>{item.amount}</td>
                    <td>{item.date}</td>
                  </tr>
                ))}
              </tbody>
            </Table>
          </div>
        )}

        {this.state.expenses.length > 0 && (
          <div>
            <h3>Expenses</h3>
            <Table striped bordered hover>
              <thead>
                <tr>
                  <th>Description</th>
                  <th>Amount</th>
                  <th>Date</th>
                </tr>
              </thead>
              <tbody>
                {this.state.expenses.map((item) => (
                  <tr key={item.id}>
                    <td>{item.description}</td>
                    <td>{item.amount}</td>
                    <td>{item.date}</td>
                  </tr>
                ))}
              </tbody>
            </Table>
          </div>
        )}

        {this.state.totalIncome > 0 && (
          <div>
            <h3>Total Income: {this.state.totalIncome}</h3>
          </div>
        )}

        {this.state.totalExpenses > 0 && (
          <div>
            <h3>Total Expenses: {this.state.totalExpenses}</h3>
          </div>
        )}
      </div>
    );
  }
}
